    false,nt"url": null,nt"notes": "This data set consists of digital water-table
    contours for the Morongo Basin. The U.S. Geological Survey constructed a water-table
    map of the Morongo ground-water basin for ground-water levels measured during the
    period January-October 1994. Water-level data were collected from 248 wells to construct
    the contours. The water-table contours were digitized from the paper map which was
    published at a scale of 1:125,000. The contour interval ranges from 3,400 to 1,500
    feet above sea level.",nt"license_title": null,nt"extras": [{ntt"key":
